import React from 'react';
import Container from 'react-bootstrap/Container';


export default function StudyLegend({ study: { ratios, ratiosEx, info, citation, comment, additionalReading } }) {
    return (
        <Container id="legend" fluid
            style={{
                backgroundColor: "lightgrey",
                margin: "2% 0 1% 0",
                textAlign: "left",
                padding: "1% 1% 1% 1%"
            }}
        >
           <p></p>

            <p> <strong>Academic papers used: </strong>{citation} </p>
            <p>Guan WJ, Ni ZY, Hu Y, Liang WH, Ou CQ, He JX, Liu L, Shan H, Lei
CL, Hui DS, Du B. Clinical characteristics of coronavirus disease 2019 in China. New England Journal of Medicine. 2020 Feb 28</p>
            </Container>
    )
}
